import React from "react";

import './question1Styles.css';

export default class Question1 extends React.Component{
    constructor(props){
        super(props);
    }
    render(){
        return (
        <div>
            <div>What is JSX?</div>
            <div>a) A standalone programming language</div>
            <div>b) A CSS framework</div>
            <div>c) A syntactic extension of JavaScript that looks like HTML</div>
            <div>d) A templating engine</div>
        </div>
        )
    }
}
